import React, { Component } from 'react';

export default class SupportScreen extends Component {
    render() {
        const outerDivStyle = {
            float: 'right',
            height: '100%',
            width: '85%'
        }

        const innerDivStyle = {
            margin: '50px',
            fontFamily: 'Quicksand'
        }

        const mainHeader = {
            fontSize: '70px',
            lineHeight: '0px'
        }

        const secondaryHeader = {
            fontSize: '60px',
            lineHeight: '0px'
        }

        const infoText = {
            fontSize: '25px'
        }

        return (
            <div style = {outerDivStyle}>
                <div style = {innerDivStyle}>
                    <p style = {mainHeader}>Need Help?</p>
                    <p style = {infoText}>Contact our support team to report bugs or make suggestions.</p>
                </div>
            </div>
        );
    }
}
